import React from 'react';
import { AppBar, Toolbar, Button, Box } from '@mui/material';
import { styled } from '@mui/system';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import baaMbooLogo from '../assets/mainlogo1.png';

const StyledAppBar = styled(AppBar)({
  backgroundColor: '#fff', // Changed to white to match the second footer
  boxShadow: '0 1px 4px rgba(0, 0, 0, 0.1)', // Lighter shadow
  color: '#666', // Default text color
});

const StyledButton = styled(Button)({
  color: '#666', // Text color from the second footer
  padding: '6px 16px', // Slightly reduced padding
  fontWeight: 500,
  textTransform: 'none',
  fontSize: '0.9rem', // Smaller, cleaner font size
  transition: 'color 0.3s ease',
  '&:hover': {
    color: '#28b463', // Accent color on hover
    backgroundColor: 'transparent',
  },
});

const CartButton = styled(Button)({
  color: '#666', // Matching text color
  padding: '6px',
  minWidth: 'auto',
  transition: 'color 0.3s ease',
  '&:hover': {
    color: '#28b463', // Hover color from the second footer
    backgroundColor: 'transparent',
  },
});

const LogoImage = styled('img')({
  height: '40px',
  width: '200px',
  cursor: 'pointer',
});

const PageContainer = styled(Box)({
  maxWidth: '1500px', // Updated to match the second footer
  width: '100%',
  margin: '0 auto',
  padding: { xs: '0 15px', sm: '0 20px' },
});

const Navbar = () => {
  return (
    <StyledAppBar position="static">
      <PageContainer>
        <Toolbar sx={{ justifyContent: 'space-between', alignItems: 'center' }}>
          <Box>
            <a href="#home" style={{ textDecoration: 'none' }}>
              <LogoImage src={baaMbooLogo} alt="Baa M Boo Logo" />
            </a>
          </Box>
          <Box sx={{ flexGrow: 1, display: 'flex', justifyContent: 'center', gap: '25px' }}>
            <StyledButton href="#home">Home</StyledButton>
            <StyledButton href="#men">Men</StyledButton>
            <StyledButton href="#women">Women</StyledButton>
            <StyledButton href="#contact">Contact</StyledButton>
          </Box>
          <Box>
            <CartButton href="#cart">
              <ShoppingCartIcon sx={{ fontSize: '24px' }} /> {/* Slightly smaller icon */}
            </CartButton>
          </Box>
        </Toolbar>
      </PageContainer>
    </StyledAppBar>
  );
};

export default Navbar;
